import { useState } from "react";
import { MainBody } from "../components/AppBox";
import { Footer } from "../components/Footer";
import { Header } from "../components/Header";
import { HomeSub } from "../components/subScreens/HomeSub";
import { FiltersList } from "../locales/filters";
import { Filter } from "../models/Filter";

export const HomeScr = () => {
  const [filter, setFilter] = useState<Filter>(FiltersList[0]);
  return (
    <MainBody>
      <HomeSub filter={filter} />
      <Footer />
    </MainBody>
  );
};
